„Cum să luați măsurarea oxigenului din sânge: 
1. Purtați ceasul cu lățimea unui deget sub osul încheieturii mâinii și purtați-l într-o poziție confortabilă pe încheietura mâinii; 
2. După ce ați intrat în modul de detectare a oxigenului din sânge, rămâneți nemișcat, asigurați-vă că încheietura mâinii este plată și ceasul este orientat în sus. Dacă stați, puteți pune brațele pe masă cu ceasul în sus;
3. Vă rugăm să mențineți brațul constant până când veți obține rezultatul final.
